import React from 'react';

function Pic() {
  return (
    <>
      <h2>Pic</h2>
      <img src="data:image/jpeg;base64," alt="Pic 1" />
      <img src="https://example.com/image2.jpg" alt="Pic 2" />
      <img src="https://example.com/image3.jpg" alt="Pic 3" />
      <img src="https://example.com/image4.jpg" alt="Pic 4" />
      <img src="https://example.com/image5.jpg" alt="Pic 5" />
      <img src="https://example.com/image6.jpg" alt="Pic 6" />

      <button id="like-btn" onClick={toggleLike}>
        Like
      </button>
      <span id="like-count"></span>
    </>
  );
}

export default Pic;
